import React, { Component } from "react";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      planets: {
        moon: [{ name: "Jonaed", count: 0 }, { name: "Ashik", count: 0 }],
        sun: [{ name: "Mission", count: 0 }, { name: "Bayjid", count: 0 }]
      }
    };
  }
  counterButtons = () => {
    console.log("this is just a simple button");
  };
  render() {
    const { planets } = this.state;
    return (
      <div className="App">
        {Object.keys(planets).map(planet => (
          <div key={planet}>
          {planet}
          <ul key={planet.person}>
            {planets[planet].map(person => (
              <li key={person}><button>{person.name}:{person.count}</button></li>
            ))}
          </ul>
          </div>
        ))}
      </div>
    );
  }
}

export default App;
